	DataLoadList: function (_holder,_objcur) {
		if( ($$$.Widget.Comment._config.CurrentAction=="next") && ($$$.Widget.Comment._config.CurrentPage == $$$.Widget.Comment._config.HolderPage)) {
			return false;
		} else if( ($$$.Widget.Comment._config.CurrentAction=="back") && ($$$.Widget.Comment._config.CurrentBackPage == 0)) {
			return false;
		}
		/*jQuery(".fmsCommentListPaginationButton").each(function () {
			$(this).attr("disabled", "disabled").unbind('click');
		});*/
		$$$.ConsoleWrite("Get Comment begin");

		var _url = $$$._config._url._service1 + "jsx/interaction/getInteraction/data.jsx";
		var _data = {
						objkey: _holder.attr("data-key"),
						ordby: _holder.attr("data-ordby")
					};
		if(typeof _objcur != "undefined" && _objcur != null && _objcur !='null') { 			
			_data.objcur = _objcur;
		} else {
			if($$$.Widget.Comment._config.CurrentAction=="next") {
				_data.page = $$$.Widget.Comment._config.CurrentPage;
			} else if($$$.Widget.Comment._config.CurrentAction=="back") {
				_data.page = $$$.Widget.Comment._config.CurrentBackPage;
			}			
		}
		//if ($$$.HashUrl.GetParam('objcur', '') != '') _data.objcur = $$$.HashUrl.GetParam('objcur', '');
	    
		jQuery('.fmsidWidgetCommentListLoading',_holder).show();

	    //if (_data.ordby == undefined) _data.ordby = "time";
		if (_data.ordby == undefined) _data.ordby = "like";

		$$$.CallService(_url, { type: 'get', cache: true, data: _data },
			function (data) {
				/* data format: 
				retvar={objkey: 'vietnamnet.vn_quoc-te_95937', like: 123, unlike: 75};
				*/
				jQuery('.fmsidWidgetCommentListLoading',_holder).hide();
				if ("object" === typeof data) {
					$$$.ConsoleWrite("Get comment success.");					
					$$$.Widget.Comment.BuildList(data,_holder);

                    if (data.totalrecord > 0) jQuery(".fmsidWidgetCommentListHeadOrderText").show();
				} else {
					$$$.ConsoleWrite("Can't get data comment list");
				}
			},
			function () {
				jQuery('.fms-commentbox .fmsLoadingbox').hide();
				$$$.ConsoleWrite("Can't get data comment list");
			}
		);
		
	}, // End DataLoadList
		
	DataSend: function () {
		if (($$$.Widget.Comment.CheckActionTimeOut($$$.Widget.Comment._holder._objectCurrent._main) == false) && ($$$.Widget.Comment._holder._valueCurrent._action == "comment")) {
			return false;
		}
			
		$$$.ConsoleWrite("Send comment begin");        
        var _url = $$$._config._url._service2 + "jsx/comment/sendComment/data.jsx";
		
		//Defined Callback
		jQuery(document).bind('CommentSuccessCallback', function (evt) {			
			var _h = $$$.Widget.Comment._holder._objectCurrent._main;
			//var _r = $$$.Widget.Rating._holder._valueCurrent.ratedval;
			
			if(evt.message=='success') {
				if($$$.Widget.Comment._holder._valueCurrent._action == "comment") {
					var _time = $$$.Timer.AddSecondToTimeNow($$$.Widget.Comment._config.CommentSendTimeOut);
					$$$.SetCookie($$$.Widget.Comment.GenKey(_h), _time, $$$.Widget.Comment._config.CommentSendTimeOut);
					$$$.Widget.Comment.LockUserStage(_h);
					$$$.Timer.SetCountDown(_time,
							function (_time) {
								$$$.Widget.Comment._config.TimeOut = _time;
								jQuery(".fmsidWidgetCommentForm .fmsidWidgetCommentBtnSendLock .num",_h).html($$$.Timer.Second2Timer(_time));
							},
							function () {
								$$$.Widget.Comment._config.TimeOut = "";
								$$$.SetCookie($$$.Widget.Comment.GenKey(_h), 0, $$$.Widget.Comment._config.CommentSendTimeOut);
								$$$.Widget.Comment.FreeUserStage(_h);
							}
						);
				} else {
					jQuery(".fmsidWidgetCommentItemFormReplies").html("");
					jQuery(".fmsidWidgetCommentForm").show();	
				}// end if								
				
				$$$.Widget.Comment.ResetForm();
				$$$.Widget.Comment.ResetLayout();
				$$$.Widget.Comment.ResetPopup();
				$$$.Widget.Comment._holder._objectCurrent = {};
				$$$.Widget.Comment._holder._valueCurrent = {};
				
				alert($$$.Widget.Comment._i18n.textSuccess);
			} else {
				if(evt.message=='fail') {
					//$$$.Widget.Rating.Mes('');
					alert($$$.Widget.Comment._i18n.textErrorFail);
				}
				if(evt.message=='flooded') {
					//$$$.Widget.Rating.Mes('');
					alert($$$.Widget.Comment._i18n.textErrorFailTime.replace("%s", $$$.Widget.Comment._config.CommentSendTimeOut));
				}
				if(evt.message=='guest') {
					//$$$.Widget.Rating.Mes('');
					$$$.User.SyncUserInfo();
				}
				if (evt.message == 'invalid') {
					if (evt.param.error == 'Fullname Empty') {
						alert($$$.Widget.Comment._i18n.textErrorInputFullname);
					}
					if (evt.param.error == 'Email Empty') {
						alert($$$.Widget.Comment._i18n.textErrorInputEmail);
						//$$$.Popup.ShowNotify("error", $$$.GetI18n('textErrorCommentInputEmail'));
					}
					if (evt.param.error == 'Email Invalid') {
						alert($$$.Widget.Comment._i18n.textErrorInputEmail);
						//$$$.Popup.ShowNotify("error", $$$.GetI18n('textErrorCommentInputEmailValid'));
					}
					if (evt.param.error == 'Content Empty') {
						alert($$$.Widget.Comment._i18n.textErrorInputMessage.replace("%d", $$$.Widget.Comment._config._input._minLength));
						//$$$.Popup.ShowNotify("error", $$$.GetI18n('textErrorCommentInputContent'));
					}
					if (evt.param.error == 'Content Invalid') {
						alert($$$.Widget.Comment._i18n.textErrorInputMessage.replace("%d", $$$.Widget.Comment._config._input._minLength));
						//$$$.Popup.ShowNotify("error", $$$.GetI18n('textErrorCommentInputContent'));
					}
				} // end if
			} // end if

			jQuery(document).unbind('CommentSuccessCallback');
		}); // end Bind LoginCallback
		
		//Config Service
		var _config_service = { 
								type: 'get',
								cache: false,
								data: $$$.Widget.Comment._holder._valueCurrent._form 
								};
		$$$.CallService(_url, _config_service,
			function (data) {
				if ("object" === typeof data) {
					$$$.ConsoleWrite("Send Comment success.");
					jQuery(document).trigger(jQuery.Event('CommentSuccessCallback',data));
				} else {
					$$$.ConsoleWrite("Can't send data Comment");
				}
			},
			function () {
				$$$.ConsoleWrite("Can't send data Comment");
			}
		);

	}, // End DataSend

