function CheckLoginGML() {
    if (!$$$.User._currentUser.Logined) {
        //not login
        // check cookie Onetap
        var ckoneTap = getCookie_VNN("oneTap");
        // Step1:  kch vo th ko hin. trn trnh duyt
        if (ckoneTap != "0") {
            // Step2: Cha bm vo oneTap th hin th onetap trn trnh duyt.
            // Hin th onetap th gi n th vin.
            // add onetap.
            oneTapLogin();
        }
    } else {
         $("#credential_picker_container").hide();
    }
}
function oneTapLogin() {
	$.ajax({
        url: 'https://accounts.google.com/gsi/client',
        dataType: 'script',
        success: function(e){
			google.accounts.id.initialize({
				client_id: GMClient_id,
				auto_select: false,
				cancel_on_tap_outside: false,
				callback: handleCredentialResponseGML
			});
			google.accounts.id.prompt((notification) => {
				if (notification.isNotDisplayed() || notification.isSkippedMoment()) {
				}
			});
		},
        async: true
    });
    
}
function setCookieGMLoginVNN(cname, cvalue, exdays) {
  var d = new Date();
  d.setTime(d.getTime() + (exdays*24*60*60*1000));
  var expires = "expires="+ d.toUTCString();
  document.cookie = cname + "=" + cvalue + ";" + expires + ";path=https://vietnamnet.vn";
}
function handleCredentialResponseGML(response) {
    // save cookie  onetap
	setCookieGMLoginVNN("oneTap",0,30)
    //document.cookie = "oneTap=0; expires=Thu, 18 Dec 2013 12:00:00 UTC";
    // redirect login page
    var loc = GMOneTap;
    var id_token = response.credential;
    var redirect_uri = window.location.href;
    window.location = loc + 'redirect_uri=' + redirect_uri + '&id_token=' + response.credential;
}
function getCookie_VNN(name) {
    let matches = document.cookie.match(new RegExp(
      "(?:^|; )" + name.replace(/([\.$?*|{}\(\)\[\]\\\/\+^])/g, '\\$1') + "=([^;]*)"
    ));
    return matches ? decodeURIComponent(matches[1]) : undefined;
}

