$(function() {
    $('.p_questions .q_opts .q_opt_val').click(function() {
        //check done
        if ($(this).parent().parent().hasClass('done'))
            return;

        $(this).addClass('select');
        $(this).parent().parent().addClass('done');

        //check finish
        if ($('.p_questions').length == $('.p_questions.done').length) {
            var total = $('.p_questions').length;
            var right = $('.p_questions.done .q_opts .q_opt_val.select[data-result="true"]').length;
            console.log('finish', right, total);
            $('<div id="QuizTotalScore"><h3>S cu tr li ng <div id="QuizCorrectAnswers"><i>' + right + '</i>/<b>' + total + '</b></div></h3></div>').insertAfter($('.p_questions:last'));
            if (right > 0)
                $('#QuizTotalScore').addClass('right');
            $('<div id="QuizRedo">Lm li</div>').insertAfter($('#QuizTotalScore')).click(function() {
                $('.p_questions.done .q_opts .q_opt_val.select').removeClass('select');
                $('.p_questions.done').removeClass('done');
                $('#QuizTotalScore').remove();
                $(this).remove();
            });
        }
    });
});
