function ActionCatgoryViewByDate(_holder, callback) {
    if ($(".glInputCalendar").length == 0) {
        var _input_hidden = $('<input type="text" class="glInputCalendar" value=""/>');
        _input_hidden.css({
            //"display": "none",
            "width": "200px",
            "height": "0px",
            "border": "0px",
            "vertical-align": "top"
        });
        _holder.before(_input_hidden);
        $('.glInputCalendar').glDatePicker({
            allowMonthSelect: false,
            allowYearSelect: false,
            //calendarOffset: { x: 16, y: 16 },
            todayDate: new Date(),
            monthNames: ['Thng 1', 'Thng 2', 'Thng 3', 'Thng 4', 'Thng 5', 'Thng 6', 'Thng 7', 'Thng 8', 'Thng 9', 'Thng 10', 'Thng 11', 'Thng 12'],
            dowNames: ['CN', 'T2', 'T3', 'T4', 'T5', 'T6', 'T7'],
            onClick: (function (el, cell, date, data) {
                //el.val(date.toLocaleDateString());
                var _day = date.getDate().toString();
                if (_day.length < 2) _day = '0' + _day;
                var _month = (date.getMonth() + 1).toString();
                if (_month.length < 2) _month = '0' + _month;
                var _year = date.getFullYear().toString();
                var _dateFull = _year + '' + _month + '' + _day;
                el.val(_dateFull);
                if (typeof callback === "function") callback(_dateFull);
                //el.val(date.toLocaleDateString());
            })
        });
    }
    $(".glInputCalendar").trigger("click");
}

