function AddIframeSetCookey() {
    var title_page = $('h1').text();
    if ($('meta[property="og:image"]').attr('content') == undefined) return;
    var images_page = $('meta[property="og:image"]').attr('content');
    if ($('link#canonical').attr('href') == undefined) return;
    var link_page = $('link#canonical').attr('href');
    var iframe_page = '<iframe class="hidden" src="https://id.vietnamnet.vn/SetCookie.html?title=' + encodeURIComponent(title_page) + '&images=' + encodeURIComponent(images_page) + '&link=' + encodeURIComponent(link_page) + '"></iframe>';
    $('body').append(iframe_page);
}



$(document).ready(function () {
    AddIframeSetCookey();
});
